            <div>

                <Accordion>
                    <AccordionSummary
                        aria-expanded={true}
                        expandIcon={<ExpandMore />}
                        aria-controls="Insurers"
                        id="Insurers"
                    >
                        <AccordionTitle title='Releasing to customer' />
                    </AccordionSummary>
                    <AccordionDetails>
                        {/* <CustomDataTable
                                    onClick={() => { console.log("sadbhj") }}
                                /> */}

                        <div className={classes.childAccordion}>
                        <Accordion>
                    <AccordionSummary
                        aria-expanded={true}
                        expandIcon={<ExpandMore />}
                        aria-controls="Insurers"
                        id="Insurers"
                    >
                        <AccordionTitle title='Tawuniya' />
                    </AccordionSummary>
                    <AccordionDetails>
                        {/* <CustomDataTable
                                    onClick={() => { console.log("sadbhj") }}
                                /> */}

                        <div className={classes.cmpWrapper}>

                        </div>

                    </AccordionDetails>
                </Accordion>
                        </div>

                    </AccordionDetails>
                </Accordion>
            </div>
        )
    }
}

SalesReview.propTypes = {
    classes: PropTypes.object.isRequired,
    // formType: PropTypes.string.isRequired,
    // changeEdit: PropTypes.string.isRequired,
    // params: PropTypes.string.isRequired,
};

export default withStyles(useStyles)(SalesReview)
